description:
Mother nature has her own strength, and walking around, you will be touched by its force!
It feels so natural, that you can taste the love in the air
The heat of the sun guides hands and fingers to touch your deepest soul
There's no way in this world, that you could find more ecstasy, than with A Touch Of Nature.

El Storm, Sunshine, Holly, Jesse Jazz, Denis Reed, Katie Gold, Kristof Cale

